const Rand = RandIntRange(1,100000);

const IsUncommon = Rand < 83989;
const IsRare = Rand >= 83989 && Rand < 99000;
const IsHeroic = Rand >= 99000 && Rand < 99990;
const IsEpic = Rand >= 99990 && Rand < 100000;
const IsLegendary = Rand == 100000;

SelectInt(IsUncommon, RandIntRange(6,11), 
SelectInt(IsRare, RandIntRange(16,23), 
SelectInt(IsHeroic, RandIntRange(31,41), 
SelectInt(IsEpic, RandIntRange(51,61), 
SelectInt(IsLegendary, 71, 86)))))
